import React, { createContext, useContext } from "react";
import "../Card/Card.css";
import JsonData from "../../data.json";
import placeHolder from "../../assets/thumbnails/112/regular/small.jpg";

const Card = () => {
  return (
    <section className="card-container">
      <CardImage />
      <CardDetails />
    </section>
  );
};

// Card Image
const CardImage = () => {
  const recommendedData = JsonData.slice(5);
  console.log(recommendedData);

  const recommendedImages = recommendedData.map((film) => {
    return (
      <img
        className="card-cover"
        src={film.thumbnail.regular.small}
        alt="film cover"
      />
    );
  });
  return <div className="card">{recommendedImages}</div>;
};

//   Card Details
const CardDetails = () => {};

export default Card;
